    "rainwater-basin-wetland-management-district-annual-narrative-report-calendar-year-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Rainwater
    Basin WMD outlines District accomplishments during the 1981 calendar year. The report
    begins with an introduction to the WMD and information about weather conditions,
    habitat conditions, land acquisition activities, and the system status. Construction,
    maintenance, and wildfires are also described. Habitat management is covered; croplands,
    grasslands, wetlands, and forests are discussed. The wildlife section of the report
    discusses endangered and threatened species, migratory birds, mammals, and non-migratory
    birds. Interpretation and recreation activities are outlined; topics include information
    and interpretation, recreation, and law enforcement. Cooperative programs, items
    of interest, and safety information are attached.",nt"license_title": "License
